sourcesContent:
import mysql from "mysql2";

const dbPool = mysql.createPool(
  process.env.DATABASE_URL ?? {
    host: 'localhost',
    user: 'root',
    database: 'week11_inha_db',
    password: 'chungdam369@',
    waitForConnections: true,
    connectionLimit: 10,
    queueLimit: 0,
  }
);

const dbPromise = dbPool.promise();

export const queryHandlers = {
  fetchStudents: async () => {
    const [data] = await dbPromise.query(`SELECT StudentId, password FROM Student`);
    return data;
  },

  fetchEnrolledCourses: async (studentId) => {
    const [data] = await dbPromise.query(`
      SELECT 
          cl.ID AS CourseId, 
          cl.Name AS CourseName, 
          cl.Professor AS CourseInstructor, 
          dep.Dname AS DepartmentName, 
          cl.Number_of_participant AS MaxParticipants
      FROM 
          class_student cs
      INNER JOIN 
          Class cl ON cs.Class_Id = cl.ID
      INNER JOIN 
          Department dep ON cl.Did = dep.ID
      WHERE 
          cs.Student_Id = ?;
    `, [studentId]);
    return data;
  },

  fetchCourseOverview: async () => {
    const [data] = await dbPromise.query(`
      SELECT 
          cl.ID AS CourseId, 
          cl.Name AS CourseName, 
          cl.Professor AS CourseInstructor, 
          dep.Dname AS DepartmentName, 
          cl.Number_of_participant AS MaxParticipants,
          (cl.Number_of_participant - COUNT(cs.Class_Id)) AS AvailableSeats
      FROM 
          Class cl
      INNER JOIN 
          Department dep ON cl.Did = dep.ID
      LEFT JOIN 
          class_student cs ON cl.ID = cs.Class_Id
      GROUP BY 
          cl.ID, cl.Name, cl.Professor, dep.Dname, cl.Number_of_participant
    `);
    return data;
  },
};

export const mutationHandlers = {
  enrollInClass: async (input) => {
    const [studentRow] = await dbPromise.query(
      `SELECT ID FROM Student WHERE StudentId = ?`,
      [input.studentId]
    );
    const studentPrimaryKey = studentRow[0]?.ID;

    if (!studentPrimaryKey) {
      throw new Error('Student not found');
    }

    const [result] = await dbPromise.query(
      `INSERT INTO class_student (Student_Id, Class_Id) VALUES (?, ?)`,
      [studentPrimaryKey, input.classId]
    );

    return result;
  },
};

