import express from "express";
import { selectSql, createSql } from '../database/sql';

const router = express.Router();

router.get('/', async function (req, res) {
    if (req.cookies.user) {
        const completedCourses = await selectSql.getCompletedCourses(req.cookies.user);
        const courseList = await selectSql.getCourseList();
        
        console.log("Completed Courses:", completedCourses);
        console.log("Course List:", courseList);

        res.render('select', { 
            user: req.cookies.user,
            title: "Enrolment",
            completedCourses,
            courseList
        });
    } else {
        res.redirect('/');
    }
});

router.post('/', async (req, res) => {
    const data = {
        cId: req.body.applyBtn, 
        sId: req.cookies.user,   
    };

    const completedCourses = await selectSql.getCompletedCourses(data.sId);
    const courseList = await selectSql.getCourseList();
    const selectedCourse = courseList.find(course => course.Id === parseInt(data.cId));
    
    const isCompleted = completedCourses.some(course => course.Id === parseInt(data.cId));
    const hasSeats = selectedCourse && selectedCourse.Remaining_participants > 0;

    if (isCompleted) {
        console.log("Error: 이미 수강 완료한 강좌입니다.");
        res.redirect('/sugang');
    } else if (!hasSeats) {
        console.log("Error: 남은 수강 인원이 없습니다.");
        res.redirect('/sugang');
    } else {
        console.log("Apply for course:", data);
        await createSql.addClass(data);  
        res.redirect('/sugang');
    }
});

module.exports = router;

