import cookieParser from "cookie-parser";
import express from "express";
import expressSession from "express-session";
import { queryHandlers } from "../database/sql";

const router = express.Router();

router.use(cookieParser());
router.use(
  expressSession({
    secret: "dilab",
    resave: true,
    saveUninitialized: true,
  })
);

router.get("/", (req, res) => {
  if (req.cookies.user) {
    res.render("main", {
      user: req.cookies.user,
    });
  } else {
    res.render("login");
  }
});

router.get("/logout", (req, res) => {
  if (req.cookies.user) {
    res.clearCookie("user");
    res.redirect("/");
  } else {
    res.redirect("/");
  }
});

router.post("/", async (req, res) => {
  const vars = req.body;
  const users = await queryHandlers.fetchStudents();
  let whoAmI = null;
  let checkLogin = false;

  users.forEach((user) => {
    if (vars.id == user.StudentId && vars.password === user.password) {
      checkLogin = true;
      whoAmI = user.StudentId;
    }
  });

  if (checkLogin) {
    res.cookie("user", whoAmI, {
      expires: new Date(Date.now() + 3600000), // 1시간 유효
      httpOnly: true,
    });
    res.redirect("/");
  } else {
    res.redirect("/");
  }
});

module.exports = router;

