import mysql from "mysql2";

const pool = mysql.createPool(
  process.env.JAWSDB_URL ?? {
    host: 'localhost',
    user: 'root',
    database: 'week11_inha_db',
    password: 'chungdam369@',
    waitForConnections: true,
    connectionLimit: 10,
    queueLimit: 0
  }
);


const promisePool = pool.promise();


export const selectSql = {
  getUsers: async () => {
    const [rows] = await promisePool.query(`SELECT StudentId, password FROM student`);
    return rows;
  },
  getCompletedCourses: async (studentId) => {
    const [rows] = await promisePool.query(`
    SELECT 
    c.ID AS Id, 
    c.Name AS Course, 
    c.Professor, 
    d.Dname AS Opening_Departments, 
    c.Number_of_participant AS Maximum_participants
FROM 
    class_student cs
JOIN 
    Class c ON cs.Class_Id = c.ID
JOIN 
    Department d ON c.Did = d.ID
WHERE 
    cs.Student_Id = 1;
    `, [studentId]);
    return rows;
},

getCourseList: async () => {
    const [rows] = await promisePool.query(`
        SELECT 
            c.ID AS Id, 
            c.Name AS Course, 
            c.Professor, 
            d.Dname AS Opening_Departments, 
            c.Number_of_participant AS Maximum_participants,
            (c.Number_of_participant - COUNT(cs.Class_Id)) AS Remaining_participants
        FROM 
            Class c
        JOIN 
            Department d ON c.Did = d.ID
        LEFT JOIN 
            class_student cs ON c.ID = cs.Class_Id
        GROUP BY 
            c.ID, c.Name, c.Professor, d.Dname, c.Number_of_participant
    `);
    return rows;
},

}

export const createSql = {
  addClass: async (data) => {
    const uid = await promisePool.query(`select Id from Student where StudentId=${data.sId}`);
    console.log(uid);
    const results = await promisePool.query (
      `insert into class_student values (${uid[0][0].Id}, ${data.cId});`
    )
    return results[0];
  }
  };

